USE sga_notas;
SET @exist := (SELECT COUNT(1) FROM information_schema.statistics WHERE table_schema = 'sga_notas' AND table_name = 'notas' AND index_name = 'uk_notas_matricula_tipo_periodo_escala');
SET @sqlstmt := IF( @exist > 0, 'ALTER TABLE notas DROP INDEX uk_notas_matricula_tipo_periodo_escala', 'SELECT ''Index not found''');
PREPARE stmt FROM @sqlstmt;
EXECUTE stmt;
DEALLOCATE PREPARE stmt;

