-- Obtener IDs de roles existentes
-- Asegurar roles esenciales (idempotente)
SELECT UUID(), 'ADMIN', 'Administrador del sistema con acceso completo'
WHERE NOT EXISTS (SELECT 1 FROM roles WHERE nombre = 'ADMIN');
SELECT UUID(), 'DOCENTE', 'Docente que puede registrar notas y ver sus clases'
WHERE NOT EXISTS (SELECT 1 FROM roles WHERE nombre = 'DOCENTE');
SELECT UUID(), 'PADRE', 'Padre o tutor que puede ver información de sus hijos'
WHERE NOT EXISTS (SELECT 1 FROM roles WHERE nombre = 'PADRE');

SET @rol_admin_id = (SELECT id FROM roles WHERE nombre = 'ADMIN' LIMIT 1);
SET @rol_docente_id = (SELECT id FROM roles WHERE nombre = 'DOCENTE' LIMIT 1);
SET @rol_padre_id = (SELECT id FROM roles WHERE nombre = 'PADRE' LIMIT 1);

