WHERE NOT EXISTS (SELECT 1 FROM roles WHERE nombre = 'ALUMNO');

SELECT UUID(), 'DIRECTOR', 'Director con acceso administrativo'
WHERE NOT EXISTS (SELECT 1 FROM roles WHERE nombre = 'DIRECTOR');

